INSERT INTO `artifact` (`arno`, `arname`, `arcat`, `arby`, `ardesc`, `arimg`) VALUES
(1, 'STEATITE OR SOAPSTONE VESSELS', 'Pottery', '-', 'While not exactly pottery, steatite vessels were the first forms used for cooking beyond the use of gourd containers, wooden bowls, shell cups, baskets or animal skins and bladders used to contain food or drink.  Many objects have been made from steatite throughout history, but this article is concerned with the containers or bowls made by early man in the Southeast. ', );
INSERT INTO `artifact` (`arno`, `arname`, `arcat`, `arby`, `ardesc`, `arimg`) VALUES
(2, 'Ancient Potteries', 'Pottery', '-', 'Pottery was important to ancient Iowans and is an important type of artifact for the archaeologist. Ceramic pots are breakable but the small fragments, or sherds, are almost indestructible, even after hundreds of years in the ground. Pots were tools for cooking, serving, and storing food, and pottery was also an avenue of artistic expression. Prehistoric potters formed and decorated their vessels in a variety of ways. Often potters in one community or region made a few characteristic styles of p', );
INSERT INTO `artifact` (`arno`, `arname`, `arcat`, `arby`, `ardesc`, `arimg`) VALUES
(3, 'Prehistoric potteries', 'Pottery', '', 'Prehistoric pots were made by several methods: coiling, paddling, or pinching and shaping. In coiling, the potter rolls a lump of clay into a coil and gradually builds up the vessel wall by adding more coils. Each coiled layer is pinched to the one beneath and the coils are subsequently thinned by squeezing between the potter\'s thumbs and fingers. Coil junctures are then smoothed. \r\nPrehistoric pottery is handmade (i.e. not wheel-turned). The clay from which it is made often contains pieces of b', );
INSERT INTO `artifact` (`arno`, `arname`, `arcat`, `arby`, `ardesc`, `arimg`) VALUES
(4, 'Neolithic  age potteries', 'Pottery', '', 'The last part of the Stone Age, when man learned to farm and to domesticate animals, is called the Neolithic Age. This time period began at different points across the globe. In the Near East it began in 9000 BCE. In southeastern Europe it began about 7000 BCE, but in northern Europe it began around 4000 BCE. Regardless of where in the world the age began one thing was clear: mankind had begun its trek out of prehistory and entered into a time of technology, innovation, and creation.\r\nTake, for ', );
INSERT INTO `artifact` (`arno`, `arname`, `arcat`, `arby`, `ardesc`, `arimg`) VALUES
(5, 'Other Potteries', 'Pottery', '', 'e.g. Mildenhall Pottery\r\nPredominately ‘S’ profile bowls with rolled rims and carinated shoulders.\r\nRound bases and angular shoulders.\r\nDecoration on some bowls, more later in the period.\r\nFlint tempered.\r\nRolled or thickened rims.\r\nRims may be decorated with oblique or trans parallel incisions or impressions.\r\nDecoration on neck parallel vertical incisions. Flint-tempered Mildenhall pottery\r\n', );
INSERT INTO `artifact` (`arno`, `arname`, `arcat`, `arby`, `ardesc`, `arimg`) VALUES
(6, 'Middle – Late Neolithic potter', 'Pottery', '', 'e.g. Grooved ware/Peterborough ware\r\nThick rimmed round based bowls.\r\nHighly decorated pottery with profuse impressions of twisted and whipped cord, reeds, sticks and the bones of small birds and mammals.\r\nDistinctive carination developed out of the carinated bowl forms of the earlier 3rd millennium.\r\nShell, grog, veg tempered.\r\nFood vessels.', );
INSERT INTO `artifact` (`arno`, `arname`, `arcat`, `arby`, `ardesc`, `arimg`) VALUES
(7, 'Late Neolithic – Early Bronze ', 'Pottery', '', 'e.g. Collared/Cordoned Urns\r\nBipartite or tripartite vessels.\r\nFrequently recovered from burial contexts and used to contain cremated bone.\r\nDeveloped from Peterborough ware.\r\nHeavy rim or collar, vertical or slightly inverted.\r\nIncised or impressed decoration incl. herringbone or chevron.\r\nStraight sided or slightly bowed body narrowing to a small flat base.\r\n', );
INSERT INTO `artifact` (`arno`, `arname`, `arcat`, `arby`, `ardesc`, `arimg`) VALUES
(8, 'Beaker pottery (c. 2200 – 1800', 'Pottery', '', 'A highly decorated fineware, with a soft orange fabric. Two main types of decoration: all-over-decorated or combed-zoned.\r\nAll-over decoration: consists of encircling lines of twisted cord or toothed-combed impressions covering whole of\r\nouter surface.\r\nComb-zoned decoration: Bands of comb-impressed decoration, geometric motifs split by undecorated bands.\r\n', );
INSERT INTO `artifact` (`arno`, `arname`, `arcat`, `arby`, `ardesc`, `arimg`) VALUES
(9, 'Dish', 'Pottery', '', 'The molcajete was used by pre-Hispanic Mesoamerican cultures, including the Aztec and Maya, stretching back several thousand years. Traditionally carved out of a single block of vesicular basalt, molcajetes are typically round in shape and supported by three short legs. They are frequently decorated with the carved head of an animal on the outside edge of the bowl, giving the molcajete the appearance of a short, stout, three-legged animal. The pig is the most common animal head used for decorati', );
INSERT INTO `artifact` (`arno`, `arname`, `arcat`, `arby`, `ardesc`, `arimg`) VALUES
(10, 'Toy', 'Pottery', '', 'Few countries in the world have as large a selection of traditional toys. They have been made from many different types of materials including wood, cloth, tin, paper mache/cartonería, porcelain, clay, palm fronds, corn husks, straw, seeds, scrap metal, glass, and more. This is particularly true of miniatures.The toys tend to have simple designs in bright colors. Mexico is unusual in that it has a wide variety of toys fired from clay, especially in Oaxaca.[5] Toys made with a very hard paper mac', );
INSERT INTO `artifact` (`arno`, `arname`, `arcat`, `arby`, `ardesc`, `arimg`) VALUES
(11, 'Spears', 'Weapons', '', 'A spear is a pole weapon consisting of a shaft, usually of wood, with a pointed head. The head may be simply the sharpened end of the shaft itself, as is the case with fire hardened spears, or it may be made of a more durable material fastened to the shaft, such as flint, obsidian, iron, steel or bronze. The most common design for hunting or combat spears since ancient times has incorporated a metal spearhead shaped like a triangle, lozenge, or leaf. The heads of fishing spears usually feature b', );
INSERT INTO `artifact` (`arno`, `arname`, `arcat`, `arby`, `ardesc`, `arimg`) VALUES
(12, 'Swords', 'Weapons', '', 'The sword has a long straight blade ranging in length from 10 to 44 inches. The blades were sometimes locally made and other times recycled from older European swords imported through colonial trade. In the case of European blades, broadswords were most common, though rapier blades were occasionally employed. The characteristic feature of the pata is its hilt which takes the form of a half-gauntlet, the inside of which is usually padded. The hilt is attached to the blade by decorative arms that ', );
INSERT INTO `artifact` (`arno`, `arname`, `arcat`, `arby`, `ardesc`, `arimg`) VALUES
(13, 'Axe', 'Weapons', '', 'A hand axe (or handaxe) is a prehistoric stone tool with two faces that is the longest-used tool in human history. It is usually made from flint or chert. It is characteristic of the lower Acheulean and middle Palaeolithic (Mousterian) periods. Its technical name (biface) comes from the fact that the archetypical model is generally bifacial Lithic flake and almond-shaped (amygdaloidal). Hand axes tend to be symmetrical along their longitudinal axis and formed by pressure or percussion. The most ', );
INSERT INTO `artifact` (`arno`, `arname`, `arcat`, `arby`, `ardesc`, `arimg`) VALUES
(14, 'Rings', 'Ornaments', '', 'A ring is a round band, usually of metal, worn as ornamental jewellery. The term \"ring\" by itself always denotes jewellery worn on the finger; when worn as an ornament elsewhere, the body part is specified, e.g. earrings, neck rings, arm rings, and toe rings. Rings always fit snugly around or in the part of the body they ornament, so bands worn loosely, like a bracelet, are not rings. Rings may be made of almost any hard material: wood, bone, stone, metal, glass, gemstone or plastic.', );
INSERT INTO `artifact` (`arno`, `arname`, `arcat`, `arby`, `ardesc`, `arimg`) VALUES
(15, 'Crown', 'Ornaments', '', 'The delicate nature of the gold crowns comes from the fact they were made from cutting thin sheet gold. The crown is impractical to wear and some believe that the crown may have been made specifically as a burial good.The use of gogok, or comma-shaped curved jewels also point to an Iranian influence and the importance of the bear cult.[clarification needed] There may also be a connection with ancient Japan because the gogok were used extensively by the ruling elite of that society as well. These', );
INSERT INTO `artifact` (`arno`, `arname`, `arcat`, `arby`, `ardesc`, `arimg`) VALUES
(17, 'jewellery', 'Fashion', 'Shubham Misal', 'ancient jewellery', );

