INSERT INTO `blog` (`bid`, `bname`, `bby`, `bdate`, `bcategory`, `bdesc`, `bimg`) VALUES
(7, 'Slate Pencils- Ontar', 'Shubham Misal', '2020-11-04', 'Tools', 'Before graphite could be locally sourced in North America, slate was used for tablets and pencils. Children would often put pencils in their mouths or clean their tablets with spit, which would spread infectious diseases in schools throughout the world. Slate would eventually be replaced by encased graphite pencils and boards to prevent future outbreaks.', );
INSERT INTO `blog` (`bid`, `bname`, `bby`, `bdate`, `bcategory`, `bdesc`, `bimg`) VALUES
(9, 'Beyond Stone & Bone', 'Heather Pringle', '2020-11-03', 'Stones', 'The great American architect Ludwig Mies van der Rohe was one of the fathers of modern architecture, and for that I am immensely grateful. I love the sleek, clean, powerful lines of Mies’s buildings, the fearlessness simplicity of his skyscrapers.  But even more than the beauty of his buildings was the beauty of his aesthetic.  It was Mies, after all, who once said, “God is in the details.”\r\nMies was thinking of architecture, of course, but I sometimes think that this aphorism was tailormade for the field of archaeology, a discipline of detail. Sometimes all these patiently gleaned details add up to, well, little more than a pile of details.  But on occasion, they make something beautiful and elegant and important, like one of Mies’s famous glass walls. And so it was recently, with a study that two archaeologists completed on a collection of 64,000-year-old stone tools from Sibudu Cave, a site perched on a forested cliff some 40 kilometers north of Durban, South Africa', );

